// css
import "../assets/css/booking.css";

// home page
function Home() {
  return (
    <div className="background container">
      <div className="row">
        <Navbar/>
        <div className="col-md-6">
        <img
            src={photograph}
            className="card-img"
            alt="Background"
            height="700px"
            width="90%"
          />
        </div>
        <div className="col-md-6">

        </div>
      </div>
    </div>

  );
}

export default Home;
